import unittest

from pycaption import (DFXPReader, SRTReader)
from pycaption.ttml_background import TTMLBackgroundWriter
from tests.mixins import SRTTestingMixIn


class TestTTMLBackgroundWriterTestCase:

    def setup_class(self):
        self.writer = TTMLBackgroundWriter()

    def test_arabic(self, sample_srt_arabic):
        caption_set = SRTReader().read(sample_srt_arabic, lang='ar')
        results = self.writer.write(caption_set)
        assert results == """<?xml version='1.0' encoding='UTF-8'?>
<tt xmlns:itts="http://www.w3.org/ns/ttml/profile/imsc1#styling"
    xmlns:ittp="http://www.w3.org/ns/ttml/profile/imsc1#parameter"
    xmlns:ittm="http://www.w3.org/ns/ttml/profile/imsc1#metadata"
    xmlns:ttm="http://www.w3.org/ns/ttml#metadata"
    xmlns:tts="http://www.w3.org/ns/ttml#styling"
    xmlns:ttp="http://www.w3.org/ns/ttml#parameter"
    xmlns:smpte="http://www.smpte-ra.org/schemas/2052-1/2010/smpte-tt"
    xmlns="http://www.w3.org/ns/ttml"
    xmlns:tt="http://www.w3.org/ns/ttml"
    xml:lang="eng" tts:extent="852px 480px"
    ttp:profile="http://www.w3.org/ns/ttml/profile/imsc1/image"
    ittp:activeArea="100% 100% 100% 100%">
<head>
    <layout>
        <region xml:id="r1" tts:origin="0% 0%" tts:extent="100% 100%" tts:showBackground="always" tts:textAlign="left" tts:displayAlign="before" />
    </layout>
</head>
<body>
<div region="r1" begin="11:06:40.000" end="12:00:50.000" smpte:backgroundImage="data:image/png;base64,"/>
<div region="r1" begin="12:22:22.000" end="13:45:00.000" smpte:backgroundImage="data:image/png;base64,"/>
<div region="r1" begin="14:12:05.000" end="15:06:57.000" smpte:backgroundImage="data:image/png;base64,"/>
<div region="r1" begin="15:21:32.000" end="16:21:57.000" smpte:backgroundImage="data:image/png;base64,"/>
</body>
</tt>"""

    def test_styling(self, sample_dfxp_from_sami_with_positioning):
        caption_set = DFXPReader().read(sample_dfxp_from_sami_with_positioning)
        results = self.writer.write(caption_set)
        assert results == """<tt xmlns:itts="http://www.w3.org/ns/ttml/profile/imsc1#styling"
    xmlns:ittp="http://www.w3.org/ns/ttml/profile/imsc1#parameter"
    xmlns:ittm="http://www.w3.org/ns/ttml/profile/imsc1#metadata"
    xmlns:ttm="http://www.w3.org/ns/ttml#metadata"
    xmlns:tts="http://www.w3.org/ns/ttml#styling"
    xmlns:ttp="http://www.w3.org/ns/ttml#parameter"
    xmlns:smpte="http://www.smpte-ra.org/schemas/2052-1/2010/smpte-tt"
    xmlns="http://www.w3.org/ns/ttml"
    xmlns:tt="http://www.w3.org/ns/ttml"
    xml:lang="eng" tts:extent="852px 480px"
    ttp:profile="http://www.w3.org/ns/ttml/profile/imsc1/image"
    ittp:activeArea="100% 100% 100% 100%">
<head>
    <layout>
        <region xml:id="r1" tts:origin="0% 0%" tts:extent="100% 100%" tts:showBackground="always" tts:textAlign="left" tts:displayAlign="before" />
    </layout>
</head>
<body>
<div region="r1" begin="02:33:29.000" end="03:25:12.000" smpte:backgroundImage="data:image/png;base64,"/>
<div region="r1" begin="04:07:28.000" end="04:43:20.000" smpte:backgroundImage="data:image/png;base64,"/>
<div region="r1" begin="04:43:20.000" end="05:12:32.000" smpte:backgroundImage="data:image/png;base64,"/>
<div region="r1" begin="05:12:32.000" end="05:48:07.000" smpte:backgroundImage="data:image/png;base64,"/>
<div region="r1" begin="05:48:07.000" end="07:26:00.000" smpte:backgroundImage="data:image/png;base64,"/>
<div region="r1" begin="07:26:00.000" end="08:56:40.000" smpte:backgroundImage="data:image/png;base64,"/>
<div region="r1" begin="08:56:40.000" end="10:03:20.000" smpte:backgroundImage="data:image/png;base64,"/>
</body>
</tt>"""
